  OPTIONAL { ?parentCommander <http://dbpedia.org/ontology/birthChild> ?commander.
             ?parentCommander <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Royalty>. }

  # Step 5: Alter ego of The Shadow
  OPTIONAL { <http://dbpedia.org/resource/The_Shadow> <http://dbpedia.org/property/alterEgo> ?alterEgo.
             FILTER(?alterEgo = "Lamont_Cranston"@en) }

  # Final step: Father of the father of both identified children
  OPTIONAL { ?father1 <http://dbpedia.org/ontology/birthChild> ?parent.
             ?father2 <http://dbpedia.org/ontology/birthChild> ?parentCommander. }

