    BIND(?person AS ?result)
  }
  OPTIONAL {
    ?landmark <http://dbpedia.org/ontology/elevation> ?elevation .
    FILTER(ABS(?elevation - 20.1168) < 0.0001) # Allowing for minor floating-point inaccuracies
    ?rulingParty <http://dbpedia.org/ontology/rulingParty> ?landmark .
    ?partyMember <http://dbpedia.org/ontology/memberOfPoliticalParty> ?rulingParty .
    BIND(?partyMember AS ?result)
