  <http://dbpedia.org/resource/Mark_Tournier> <http://dbpedia.org/ontology/birthPlace> ?birthPlace .
  FILTER (isLiteral(?birthPlace) && datatype(?birthPlace) = xsd:string)
  OPTIONAL { 
    ?decedent <http://dbpedia.org/ontology/deathPlace> ?deathPlace .
    FILTER (?deathPlace = ?birthPlace)
  }
}

SELECT ?result WHERE {
  # Step 1: Find the child of William I of Sicily who is royalty
  <http://dbpedia.org/resource/William_I_of_Sicily> <http://dbpedia.org/ontology/child> ?v0 .
  ?v0 <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Royalty> .

  # Step 2: Find the father of that child
  ?v0 <http://dbpedia.org/ontology/father> ?result .

  # Step 3: Find the child of Roger II of Sicily who is royalty
  OPTIONAL {
    <http://dbpedia.org/resource/Roger_II_of_Sicily> <http://dbpedia.org/ontology/child> ?v1 .
    ?v1 <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Royalty> .

    # Step 4: Find the parent of that child
    OPTIONAL {
      ?v1 <http://dbpedia.org/ontology/parent> ?v2 .

      # Step 5: Identify any children of this parent and find their father
      ?v2 <http://dbpedia.org/ontology/child> ?v3 .
      ?v3 <http://dbpedia.org/ontology/father> ?result .
    }
  }
}

SELECT ?result WHERE {
  # Player in Juan Carlos Molina
  <http://dbpedia.org/resource/Juan_Carlos_Molina_(footballer)> <http://dbpedia.org/ontology/player> ?result .

  # Films directed by Manuel Huerga
  ?film <http://dbpedia.org/property/director> <http://dbpedia.org/resource/Manuel_Huerga> .

  # Actor in the film who is a soccer player and athlete
  ?actor <http://dbpedia.org/ontology/starring> ?film ;
         <http://dbpedia.org/ontology/player> ?result2 ;
         <http://www.w3.org/2000/01/rdf-schema#label> ?actorLabel .

  FILTER(CONTAINS(LCASE(?actorLabel), "soccer player") && CONTAINS(LCASE(?actorLabel), "athlete"))

  # Find common player
  FILTER(?result = ?result2)
}

