  }
}

SELECT ?result WHERE {
  OPTIONAL {
    <http://dbpedia.org/resource/Elena_Žalinkevičaitė-Petrauskienė> <http://dbpedia.org/ontology/birthPlace> ?birthPlace .
    ?entity <http://www.w3.org/2000/01/rdf-schema#label> ?placeLabel .
    FILTER (lang(?placeLabel) = "en")
    BIND(IRI(CONCAT("http://dbpedia.org/resource/", REPLACE(LCASE(?placeLabel), " ", "_"))) AS ?entity)
    VALUES ?result { ?entity }
  }
  OPTIONAL {
    <http://dbpedia.org/resource/Alexander_Lvovich_Davydov> <http://dbpedia.org/ontology/war> ?war .
    ?entity <http://www.w3.org/2000/01/rdf-schema#label> ?warLabel .
    FILTER (lang(?warLabel) = "en")
    BIND(IRI(CONCAT("http://dbpedia.org/resource/", REPLACE(LCASE(?warLabel), " ", "_"))) AS ?entity)
    VALUES ?result { ?entity }
  }
}

